	    len += (32 * 5) / 8;
	    writer.write(len, 16);
	    Packet.Name.encode(record.primary, writer);
	    Packet.Name.encode(record.admin, writer);
	    writer.write(record.serial, 32);
	    writer.write(record.refresh, 32);
	    writer.write(record.retry, 32);
