	  writer.write(record.family, 16);
	  writer.write(record.sourcePrefixLength, 8);
	  writer.write(record.scopePrefixLength, 8);
	  writer.write(ip[0], 8);
	  writer.write(ip[1], 8);
	  writer.write(ip[2], 8);
	  writer.write(ip[3], 8);
